  false,\n\t\"url\": null,\n\t\"notes\": \"This resource is available as a downloadable
  file, ESRI Service, and as a Web Feature service.  Resource includes seven plates
  with downloadable images:  Plate I: Surficial Material, Plate II: Bedrock, Plate
  III: Ground Water Potential, Plate IV: Solid Waste Disposal Conditions, Plate V:
  Septic Tank Conditions, Plate VI: General Construction Conditions, and Plate VII:
  Sand and Gravel Reserves. Resource also includes text on Environmental planning
  for the Burlington-Middlebury Region, Vermont. For more information see links provided.
  \ This is the third report concerning a series of environmental studies sponsored
  by the Vermont Geological Survey. The first study was completed in the Barre-Montpelier
  region and a report was published in 1971. The second survey was in the Rutland-Brandon
  region and a report on this work was published in 1972. The present report, for
  publication in 1973, is concerned with the geology of the Burlington-Middlebury
  region (Figure 1). The purpose of these reports is to describe the geology of the
  region concerned and to outline the geologic conditions on a series of large-scale
  maps in such a way as to make the material available for use by planners. Inasmuch
  as planning agencies do not usually have geologists on their staffs, these reports
  attempt to supply the geologic background, in condensed and simplified form, necessary
  for adequate planning.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
